Directional light does not have a position, its rays are always parallel and it has a particular direction in space. An example of directional light in real-life could be our Sun. Even if it is a point light, it is so far away from the Earth, so we can assume that its rays are always parallel. Directional light sources are suitable for outdoor scenes. A directional light source could be created like this: # extern crate fyrox;
# use fyrox::{
# core::pool::Handle,
# scene::{
# base::BaseBuilder,
# light::{directional::DirectionalLightBuilder, BaseLightBuilder},
# node::Node,
# Scene,
# },
# }; fn create_directional_light(scene: &mut Scene) -> Handle<Node> { DirectionalLightBuilder::new(BaseLightBuilder::new(BaseBuilder::new())) .build(&mut scene.graph)
} By default, the light source will be oriented to lit "the ground". In other words its direction will be faced towards (0.0, -1.0, 0.0) vector. You can rotate it as you want by setting local transform of it while building. Something like this: # extern crate fyrox;
# use fyrox::{
# core::{
# algebra::{UnitQuaternion, Vector3},
# pool::Handle,
# },
# scene::{
# base::BaseBuilder,
# light::{directional::DirectionalLightBuilder, BaseLightBuilder},
# node::Node,
# transform::TransformBuilder,
# Scene,
# },
# }; fn create_directional_light(scene: &mut Scene) -> Handle<Node> { DirectionalLightBuilder::new(BaseLightBuilder::new( BaseBuilder::new().with_local_transform( TransformBuilder::new() .with_local_rotation(UnitQuaternion::from_axis_angle( &Vector3::x_axis(), -45.0f32.to_radians(), )) .build(), ), )) .build(&mut scene.graph)
}

