Spot and point lights support light scattering effect. Imagine you're walking with a flashlight in a foggy weather, the fog will scatter the light from your flashlight making it, so you'll see the "light volume". Light scattering is enabled by default , so you don't have to do anything to enable it. However, in some cases you might want to disable it, you can do this either while building a light source or change light scattering options on existing light source. Here is the small example of how to do that. # extern crate fyrox;
# use fyrox::{
# core::pool::Handle,
# scene::{node::Node, light::BaseLight, Scene},
# }; fn disable_light_scatter(scene: &mut Scene, light_handle: Handle<Node>) { scene.graph[light_handle] .query_component_mut::<BaseLight>() .unwrap() .enable_scatter(false);
} You could also change the amount of scattering per each color channel, using this you could imitate the Rayleigh scattering : # extern crate fyrox;
# use fyrox::{
# core::{algebra::Vector3, pool::Handle},
# scene::{node::Node, light::BaseLight, Scene},
# }; fn use_rayleigh_scattering(scene: &mut Scene, light_handle: Handle<Node>) { scene.graph[light_handle] .query_component_mut::<BaseLight>() .unwrap() .set_scatter(Vector3::new(0.03, 0.035, 0.055));
}

