Outdoor scenes usually have distant objects that can't be reached, these can be mountains, sky, distant forest, etc. such objects can be pre-rendered and then applied to a huge cube around camera, it always will be rendered first and will be the background of your scene. To create a Skybox and set it to a camera, you can use the following code: # extern crate fyrox;
# use fyrox::{
# core::{futures::executor::block_on, pool::Handle},
# engine::resource_manager::ResourceManager,
# resource::texture::TextureWrapMode,
# scene::{
# base::BaseBuilder,
# camera::{CameraBuilder, SkyBox, SkyBoxBuilder},
# node::Node,
# Scene,
# },
# }; async fn create_skybox(resource_manager: ResourceManager) -> SkyBox { // Load skybox textures in parallel. let (front, back, left, right, top, bottom) = fyrox::core::futures::join!( resource_manager.request_texture("path/to/front.jpg"), resource_manager.request_texture("path/to/back.jpg"), resource_manager.request_texture("path/to/left.jpg"), resource_manager.request_texture("path/to/right.jpg"), resource_manager.request_texture("path/to/up.jpg"), resource_manager.request_texture("path/to/down.jpg") ); // Unwrap everything. let skybox = SkyBoxBuilder { front: Some(front.unwrap()), back: Some(back.unwrap()), left: Some(left.unwrap()), right: Some(right.unwrap()), top: Some(top.unwrap()), bottom: Some(bottom.unwrap()), } .build() .unwrap(); // Set S and T coordinate wrap mode, ClampToEdge will remove any possible seams on edges // of the skybox. let skybox_texture = skybox.cubemap().unwrap(); let mut data = skybox_texture.data_ref(); data.set_s_wrap_mode(TextureWrapMode::ClampToEdge); data.set_t_wrap_mode(TextureWrapMode::ClampToEdge); skybox
} fn create_camera(scene: &mut Scene, resource_manager: ResourceManager) -> Handle<Node> { CameraBuilder::new(BaseBuilder::new()) .with_skybox(block_on(create_skybox(resource_manager))) .build(&mut scene.graph)
}

