Rectangle nodes does not support custom materials - it is a simplified version of a Mesh node that allows you draw a rectangle with a texture and a color. Its main purpose is to be able to start making games as quick as possible without diving too deep into details (shaders, render passes, etc.). You can still create a "rectangle" with custom material, use Mesh node with single rectangle surface: # extern crate fyrox;
# use fyrox::{
# core::{
# algebra::{Matrix4, Vector3},
# parking_lot::Mutex,
# pool::Handle,
# },
# material::{Material, SharedMaterial},
# scene::{
# base::BaseBuilder,
# graph::Graph,
# mesh::{
# surface::{SurfaceBuilder, SurfaceData, SurfaceSharedData},
# MeshBuilder, RenderPath,
# },
# node::Node,
# transform::TransformBuilder,
# },
# };
# use std::sync::Arc; fn create_rect_with_custom_material( graph: &mut Graph, material: SharedMaterial,
) -> Handle<Node> { MeshBuilder::new( BaseBuilder::new().with_local_transform( TransformBuilder::new() .with_local_scale(Vector3::new(0.4, 0.2, 1.0)) .build(), ), ) .with_surfaces(vec![SurfaceBuilder::new(SurfaceSharedData::new( SurfaceData::make_quad(&Matrix4::identity()), )) .with_material(material) .build()]) .with_render_path(RenderPath::Forward) .build(graph)
} This will effectively "mimic" the Rectangle node, but will allow you to use the full power of custom shaders. Keep in mind that Mesh nodes will be rendered via Deferred Renderer, while Rectangle nodes rendered with specialized renderer, that might result in some graphical artifacts. Rectangle nodes has limited lighting support, it means that they still will be lit by standard scene lights, but it will be a very simple diffuse lighting without any "physically correct" lighting. This is perfectly ok for 95% of 2D games, if you want to add custom lighting then you should use custom shader. Rectangle nodes works well with 2D physics nodes, check 2D physics section of the book for more info.

