Due to the nature of the software development, some bugs are inevitably sneak in the major releases. Due to this fact, you may want to use the latest engine version from its repository on GitHub, because it most likely has some bugs fixed (you can also help fixing any bugs you find or at least file an issue ). The first step you need to do is to install the latest fyrox-template, it can be done in a single cargo command: cargo install fyrox-template --force --git https://github.com/FyroxEngine/Fyrox This will ensure that you are using the latest project/script template generator. It is important, because old versions of template generator will most likely generate outdated code, that is no longer compatible with the engine. To switch to the latest version of the engine on existing project, you need to specify paths for fyrox and fyroxed_base dependencies to point them on remote repository. There are three places where you need to do this: game, executor, editor projects. At first open game/Cargo.toml and change fyrox dependency to this: [dependencies]
fyrox = { git = "https://github.com/FyroxEngine/Fyrox" } Do the same for executor/Cargo.toml. The editor has two dependencies we need to change fyrox and fyroxed_base. Open the editor/Cargo.toml and set both fyrox and fyroxed_base dependencies to the following: [dependencies]
fyrox = { git = "https://github.com/FyroxEngine/Fyrox" }
fyroxed_base = { git = "https://github.com/FyroxEngine/Fyrox" } Now your game will use the latest engine and editor, but beware - there could be some API breaks. You can avoid this by specifying a particular commit, just add rev = "desired_commit_hash" to every dependency like so: [dependencies]
fyrox = { git = "https://github.com/FyroxEngine/Fyrox", rev = "0195666b30562c1961a9808be38b5e5715da43af" }
fyroxed_base = { git = "https://github.com/FyroxEngine/Fyrox", rev = "0195666b30562c1961a9808be38b5e5715da43af" } To keep local git repository of the engine up-to-date, you just need to call cargo update in the root of project's workspace. This will pull the latest changes from remote (unless there is no rev specified). Learn more about dependency paths in the official cargo documentation here .

