# core::pool::Handle,
# engine::resource_manager::ResourceManager,
# gui::{image::ImageBuilder, widget::WidgetBuilder, BuildContext, UiNode},
# resource::texture::TextureKind,
# utils::into_gui_texture,
# }; async fn create_image( ctx: &mut BuildContext<'_>, resource_manager: ResourceManager,
) -> Handle<UiNode> { // Ask resource manager to load the texture and wait while it loads using `.await`. if let Ok(texture) = resource_manager .request_texture("path/to/your/texture.png") .await { // A texture can be not only rectangular, so we must check that. let texture_kind = texture.data_ref().kind(); if let TextureKind::Rectangle { width, height } = texture_kind { return ImageBuilder::new( WidgetBuilder::new() .with_width(width as f32) .with_height(height as f32), ) .with_texture(into_gui_texture(texture)) .build(ctx); } } // Image wasn't created. Handle::NONE
} This function can be used as-is whenever you need to create an Image that have same size as the source file. It is marked as async because resource loading (texture is a resource) happens in separate thread and to get actual texture data we must wait it. If you don't want to use async, then use any executor to block current thread and execute the promise immediately: # extern crate fyrox;
