# resource_manager: ResourceManager,
# ) -> Handle<UiNode> {
# Handle::NONE
# }
fn create_image_sync( ctx: &mut BuildContext<'_>, resource_manager: ResourceManager,
) -> Handle<UiNode> { fyrox::core::futures::executor::block_on(create_image(ctx, resource_manager))
}

