Text widget can accept the following list of messages at runtime (respective constructors are name with small letter - TextMessage::Text -> TextMessage::text(widget_handle, direction, text)): TextMessage::Text - sets new text for a Text widget. TextMessage::Wrap - sets new wrapping mode . TextMessage::Font - sets new font TextMessage::VerticalAlignment and TextMessage::HorizontalAlignment sets vertical and horizontal text alignment respectively. TextMessage::Shadow - enables or disables shadow casting TextMessage::ShadowDilation - sets "thickness" of the shadows under the tex. TextMessage::ShadowBrush - sets shadow brush (allows you to change color and even make shadow with color gradients). TextMessage::ShadowOffset - sets offset of the shadows. An example of changing text at runtime could be something like this: # extern crate fyrox;
# use fyrox::{
# core::pool::Handle,
# gui::{
# message::{MessageDirection},
# UiNode, UserInterface,
# text::TextMessage
# },
# };
fn request_change_text(ui: &UserInterface, text_widget_handle: Handle<UiNode>, text: &str) { ui.send_message(TextMessage::text( text_widget_handle, MessageDirection::ToWidget, text.to_owned(), ))
} Please keep in mind, that like any other situation when you "changing" something via messages, you should remember that the change is not immediate. The change will be applied on ui.poll_message(..) call somewhere in your code (or will be done automatically if you're using scripts or Framework (obsolete)).

