The engine provides proc-macro, that uses code generation to implement Visit trait for you. All you need to do is to add #[derive(Visit)] to your struct/enum. Code generation in most cases is capable to generate typical implementation for serialization/deserialization. You should prefer proc-macro to manual implementation in most cases. The macro supports few very useful attributes, that can be added to fields of a struct/enum: #[visit(optional)] - forces the engine to ignore any errors that may occur during deserialization, leaving a field's value in default state. Very useful option if you're adding a new field to your structure, otherwise the engine will refuse to continue loading of your struct. In case of scripts, deserialization will stop on missing field, and it will be partially loaded. #[visit(rename = "new_name")] - replaces the name of a field with given value. Useful if you need to rename a field in the code, but leave backward compatibility with previous versions. #[visit(skip)] - ignores a field completely. Useful if you don't want to serialize a field at all, or a field is not serializable. To use the macro, you must import all types related to Visit trait by use fyrox::core::visitor::prelude::*;. Here's an example: # extern crate fyrox;
use fyrox::core::visitor::prelude::*; #[derive(Visit)]
struct MyStruct { foo: u32, #[visit(rename = "baz")] foobar: f32, #[visit(optional)] optional: String, #[visit(skip)] ignored: usize,
}

