To serialize an object all you need to do is to create an instance of a Visitor in either read or write mode and use it like so: # extern crate fyrox;
use fyrox::core::visitor::prelude::*;
use std::path::Path; #[derive(Visit, Default)]
struct MyStruct { foo: u32, #[visit(rename = "baz")] foobar: f32, #[visit(optional)] optional: String, #[visit(skip)] ignored: usize,
} async fn visit_my_structure(path: &Path, object: &mut MyStruct, write: bool) -> VisitResult { if write { let mut visitor = Visitor::new(); object.visit("MyObject", &mut visitor)?; // Dump to the path. visitor.save_binary(path) } else { let mut visitor = Visitor::load_binary(path).await?; // Create default instance of an object. let mut my_object = MyStruct::default(); // "Fill" it with contents from visitor. my_object.visit("MyObject", &mut visitor) }
} The key function here is visit_my_structure which works in both serialization and deserialization modes depending on write flag value. When write is true (serialization), we're creating a new empty visitor and filling it with values from our object and then "dump" its content to binary file. When write is false (deserialization), we're loading contents of a file, creating the object in its default state and then "filling" it with values from the visitor.

