const TIMESTEP: f32 = 1.0 / 60.0; struct Game { // Empty for now.
} impl Game { pub fn new() -> Self { Self {} } pub fn update(&mut self) { // Game logic will be placed here. }
} fn main() { // Configure main window first. let window_builder = WindowBuilder::new().with_title("3D Shooter Tutorial"); // Create event loop that will be used to "listen" events from the OS. let event_loop = EventLoop::new(); // Finally create an instance of the engine. let serialization_context = Arc::new(SerializationContext::new()); let mut engine = Engine::new(EngineInitParams { window_builder, resource_manager: ResourceManager::new(serialization_context.clone()), serialization_context, events_loop: &event_loop, vsync: false, headless: false }) .unwrap(); // Initialize game instance. It is empty for now. let mut game = Game::new(); // Run the event loop of the main window. which will respond to OS and window events and update // engine's state accordingly. Engine lets you to decide which event should be handled, // this is a minimal working example of how it should be. let mut previous = time::Instant::now(); let mut lag = 0.0; event_loop.run(move |event, _, control_flow| { match event { Event::MainEventsCleared => { // This main game loop - it has fixed time step which means that game // code will run at fixed speed even if renderer can't give you desired // 60 fps. let elapsed = previous.elapsed(); previous = time::Instant::now(); lag += elapsed.as_secs_f32(); while lag >= TIMESTEP { lag -= TIMESTEP; // Run our game's logic. game.update(); // Update engine each frame. engine.update(TIMESTEP, control_flow, &mut lag, Default::default()); } // Rendering must be explicitly requested and handled after RedrawRequested event is received. engine.get_window().request_redraw(); } Event::RedrawRequested(_) => { // Render at max speed - it is not tied to the game code. engine.render().unwrap(); } Event::WindowEvent { event, .. } => match event { WindowEvent::CloseRequested => *control_flow = ControlFlow::Exit, WindowEvent::KeyboardInput { input, .. } => { // Exit game by hitting Escape. if let Some(VirtualKeyCode::Escape) = input.virtual_keycode { *control_flow = ControlFlow::Exit } } WindowEvent::Resized(size) => { // It is very important to handle Resized event from window, because // renderer knows nothing about window size - it must be notified // directly when window size has changed. engine.set_frame_size(size.into()).unwrap(); } _ => (), }, _ => *control_flow = ControlFlow::Poll, } });
} Wow! There is lots of code for such a simple task. Fear not, everything here is pretty straightforward, let's dive into this code and disassemble it line by line. Just skip imports, it's too boring. Let's look at this line: const TIMESTEP: f32 = 1.0 / 60.0; Here we define a rate of update for logic of our future game, just sticking to common 60 FPS. Next goes the skeleton of the game, just a struct with two methods. It will be filled later in this tutorial. struct Game { // Empty for now.
} impl Game { pub fn new() -> Self { Self {} } pub fn update(&mut self) { // Game logic will be placed here. }
} Finally, we at the point where the interesting stuff happens - fn main(). We're starting by creating a window builder: # extern crate fyrox;
# use fyrox::window::WindowBuilder;
let window_builder = WindowBuilder::new().with_title("3D Shooter Tutorial"); The builder will be used later by the engine to create a window. Next we're creating our event loop: # extern crate fyrox;
# use fyrox::event_loop::EventLoop;
let event_loop = EventLoop::new(); The event loop is a "magic" thing that receives events from the operating system and feeds your application, this is a very important part which makes the application work. Finally, we're creating an instance of the engine: let serialization_context = Arc::new(SerializationContext::new());
let mut engine = Engine::new(EngineInitParams { window_builder, resource_manager: ResourceManager::new(serialization_context.clone()), serialization_context, events_loop: &event_loop, vsync: false,
})
.unwrap(); At first, we're creating an instance of SerializationContext - it is used to store type constructors used for serialization needs. Next, we're filling EngineInitParams structure, there is nothing interesting there, except maybe a flag that is responsible for vertical synchronization (VSync). In this tutorial we'll have VSync disabled, because it requires specific platform-dependent extensions which are not always available and calling .unwrap() might result in panic on some platforms. Next we're creating an instance of the game, remember this line, it will be changed soon: let mut game = Game::new(); Next we define two variables for the game loop: let clock = time::Instant::now();
let mut elapsed_time = 0.0; At first, we "remember" the starting point of the game in time. The next variable is used to control the game loop. Finally, we run the event loop and start checking for events coming from the OS: event_loop.run(move |event, _, control_flow| { match event { ... }
}); Let's look at each event separately starting from Event::MainEventsCleared: Event::MainEventsCleared => { // This main game loop - it has fixed time step which means that game // code will run at fixed speed even if renderer can't give you desired // 60 fps. let mut dt = clock.elapsed().as_secs_f32() - elapsed_time; while dt >= TIMESTEP { dt -= TIMESTEP; elapsed_time += TIMESTEP; // Run our game's logic. game.update(); // Update engine each frame. engine.update(TIMESTEP); } // Rendering must be explicitly requested and handled after RedrawRequested event is received. engine.get_window().request_redraw();
} This is the heart of game loop - it stabilizes update rate of game logic by measuring time from last update call and performs a various amount of iterations based on an amount of time since last update. This makes the game logic update rate independent of FPS - it will be always 60 Hz for game logic even if FPS is 10. The while loop contains game.update() and engine.update(TIMESTEP) calls to update game's logic and engine internals respectively. After the loop we're asking the engine to render the next frame. In the next match arm Event::RedrawRequested we're handing our request: Event::RedrawRequested(_) => { // Render at max speed - it is not tied to the game code. engine.render().unwrap();
} As you can see rendering happens in a single line of code. Next we need to handle window events: Event::WindowEvent { event, .. } => match event { WindowEvent::CloseRequested => *control_flow = ControlFlow::Exit, WindowEvent::KeyboardInput { input, .. } => { // Exit game by hitting Escape. if let Some(VirtualKeyCode::Escape) = input.virtual_keycode { *control_flow = ControlFlow::Exit } } WindowEvent::Resized(size) => { // It is very important to handle Resized event from window, because // renderer knows nothing about window size - it must be notified // directly when window size has changed. engine.set_frame_size(size.into()).unwrap(); } _ => (),
}, Here we're just checking if the player has hit Escape button and exit game if so. Also, when WindowEvent::Resized is received, we're notifying renderer about that, so it's render targets will be resized too. The final match arm is for every other event, nothing fancy here - just asking engine to continue listening for new events. _ => *control_flow = ControlFlow::Poll, So far so good. This small piece of code just creates a new window and fills it with black color, now we can start writing the game. Window Let's start by creating a simple scene where we'll test our character controller. This is the time when Fyroxed comes into play - Fyroxed is a native scene editor of the engine. It is worth mentioning what "scene editor" means: unlike many other engines (Unity, UnrealEngine, etc.), Fyroxed does not allow you to run your game inside it, instead you just edit your scene, save it in the editor and load it in your game. Being able to run a game inside the editor was a very huge task for one person, and I just chose the easiest way. Alright, back to the interesting stuff. Build the editor first using instructions from its GitHub page using specific commit stated in the beginning of the article.

