We've made a lot of things already, but still can't move in the scene. Let's fix this! We'll start writing the character controller which will allow us to walk in our scene. Let's start with a chunk of code as usual: # extern crate fyrox;
# use fyrox::{
# core::{
# algebra::{UnitQuaternion, Vector3},
# pool::Handle,
# },
# engine::{resource_manager::ResourceManager, Engine},
# event::{DeviceEvent, ElementState, Event, VirtualKeyCode, WindowEvent},
# event_loop::{ControlFlow, EventLoop},
# resource::texture::TextureWrapMode,
# scene::{
# base::BaseBuilder,
# camera::{CameraBuilder, SkyBox, SkyBoxBuilder},
# collider::{ColliderBuilder, ColliderShape},
# node::Node,
# rigidbody::RigidBodyBuilder,
# transform::TransformBuilder,
# Scene,
# },
# window::WindowBuilder,
# };
# use std::time; #[derive(Default)]
struct InputController { move_forward: bool, move_backward: bool, move_left: bool, move_right: bool, pitch: f32, yaw: f32,
} struct Player { camera: Handle<Node>, rigid_body: Handle<Node>, controller: InputController,
} impl Player { fn new(scene: &mut Scene) -> Self { // Create rigid body with a camera, move it a bit up to "emulate" head. let camera; let rigid_body_handle = RigidBodyBuilder::new( BaseBuilder::new() .with_local_transform( TransformBuilder::new() // Offset player a bit. .with_local_position(Vector3::new(0.0, 1.0, -1.0)) .build(), ) .with_children(&[ { camera = CameraBuilder::new( BaseBuilder::new().with_local_transform( TransformBuilder::new() .with_local_position(Vector3::new(0.0, 0.25, 0.0)) .build(), ), ) .build(&mut scene.graph); camera }, // Add capsule collider for the rigid body. ColliderBuilder::new(BaseBuilder::new()) .with_shape(ColliderShape::capsule_y(0.25, 0.2)) .build(&mut scene.graph), ]), ) // We don't want the player to tilt. .with_locked_rotations(true) // We don't want the rigid body to sleep (be excluded from simulation) .with_can_sleep(false) .build(&mut scene.graph); Self { camera, rigid_body: rigid_body_handle, controller: Default::default(), } } fn update(&mut self, scene: &mut Scene) { // Set pitch for the camera. These lines responsible for up-down camera rotation. scene.graph[self.camera].local_transform_mut().set_rotation( UnitQuaternion::from_axis_angle(&Vector3::x_axis(), self.controller.pitch.to_radians()), ); // Borrow rigid body node. let body = scene.graph[self.rigid_body].as_rigid_body_mut(); // Keep only vertical velocity, and drop horizontal. let mut velocity = Vector3::new(0.0, body.lin_vel().y, 0.0); // Change the velocity depending on the keys pressed. if self.controller.move_forward { // If we moving forward then add "look" vector of the body. velocity += body.look_vector(); } if self.controller.move_backward { // If we moving backward then subtract "look" vector of the body. velocity -= body.look_vector(); } if self.controller.move_left { // If we moving left then add "side" vector of the body. velocity += body.side_vector(); } if self.controller.move_right { // If we moving right then subtract "side" vector of the body. velocity -= body.side_vector(); } // Finally new linear velocity. body.set_lin_vel(velocity); // Change the rotation of the rigid body according to current yaw. These lines responsible for // left-right rotation. body.local_transform_mut() .set_rotation(UnitQuaternion::from_axis_angle( &Vector3::y_axis(), self.controller.yaw.to_radians(), )); } fn process_input_event(&mut self, event: &Event<()>) { match event { Event::WindowEvent { event, .. } => { if let WindowEvent::KeyboardInput { input, .. } = event { if let Some(key_code) = input.virtual_keycode { match key_code { VirtualKeyCode::W => { self.controller.move_forward = input.state == ElementState::Pressed; } VirtualKeyCode::S => { self.controller.move_backward = input.state == ElementState::Pressed; } VirtualKeyCode::A => { self.controller.move_left = input.state == ElementState::Pressed; } VirtualKeyCode::D => { self.controller.move_right = input.state == ElementState::Pressed; } _ => (), } } } } Event::DeviceEvent { event, .. } => { if let DeviceEvent::MouseMotion { delta } = event { self.controller.yaw -= delta.0 as f32; self.controller.pitch = (self.controller.pitch + delta.1 as f32).clamp(-90.0, 90.0); } } _ => (), } }
} This is all the code we need for character controller, quite a lot actually, but as usual everything here is pretty straightforward. # extern crate fyrox;
# use fyrox::core::pool::Handle;
# use fyrox::engine::Engine;
# use fyrox::scene::Scene;
# struct Player;
# impl Player {
# fn new(_scene: &mut Scene) -> Self {
# Self
# }
# fn update(&mut self, _scene: &mut Scene) {}
# }
// Also we must change Game structure a bit too and the new() code.
struct Game { scene: Handle<Scene>, player: Player, // New
} impl Game { pub async fn new(engine: &mut Engine) -> Self { let mut scene = Scene::new(); // Load a scene resource and create its instance. engine .resource_manager .request_model("data/models/scene.rgs") .await .unwrap() .instantiate(&mut scene); Self { player: Player::new(&mut scene), // New scene: engine.scenes.add(scene), } } pub fn update(&mut self, engine: &mut Engine) { self.player.update(&mut engine.scenes[self.scene]); // New }
} We've moved camera creation to Player, because now the camera is attached to the player's body. Also, we must add this line in the beginning of event_loop.run(...) to let player handle input events: game.player.process_input_event(&event); So, let's try to understand what happens in this huge chunk of code. Let's start from the InputController struct, it holds the state of the input for a single frame and rotations of player "parts". #[derive(Default)]
struct InputController { move_forward: bool, move_backward: bool, move_left: bool, move_right: bool, pitch: f32, yaw: f32,
} Next goes the Player::new() function. First, we're creating a simple chain of nodes of different kinds in the scene graph . let camera;
let rigid_body_handle = RigidBodyBuilder::new( BaseBuilder::new() .with_local_transform( TransformBuilder::new() // Offset player a bit. .with_local_position(Vector3::new(0.0, 1.0, -1.0)) .build(), ) .with_children(&[ { camera = CameraBuilder::new( BaseBuilder::new().with_local_transform( TransformBuilder::new() .with_local_position(Vector3::new(0.0, 0.25, 0.0)) .build(), ), ) .build(&mut scene.graph); camera }, // Add capsule collider for the rigid body. ColliderBuilder::new(BaseBuilder::new()) .with_shape(ColliderShape::capsule_y(0.25, 0.2)) .build(&mut scene.graph), ]), ) // We don't want the player to tilt. .with_locked_rotations(true) // We don't want the rigid body to sleep (be excluded from simulation) .with_can_sleep(false) .build(&mut scene.graph); Basically we're making something like this: Graph As you can see, the camera is attached to the rigid body and has a relative position of (0.0, 0.25, 0.0). So when we'll move rigid body, the camera will move too (and rotate of course). Self { camera, rigid_body: rigid_body_handle, controller: Default::default(),
} Next goes the fn update(...) function, it is responsible for movement of the player. It starts from these lines: // Set pitch for the camera. These lines responsible for up-down camera rotation.
scene.graph[self.camera].local_transform_mut().set_rotation( UnitQuaternion::from_axis_angle(&Vector3::x_axis(), self.controller.pitch.to_radians()),
); We're borrowing the camera from the graph (scene.graph[self.camera]) and modifying its local rotation, using a quaternion built from an axis, and an angle. This rotates camera in vertical direction. Let's talk about borrowing in the engine. Almost every object in the engine "lives" in generational arenas (pool in fyrox's terminology). Pool is a contiguous chunk of memory, to be able to "reference" an object in a pool Fyrox uses handles. Almost every entity has a single owner - the engine, so to mutate or read data from an entity your have to borrow it first, like this: // Borrow rigid body node.
let body = scene.graph[self.rigid_body].as_rigid_body_mut(); This piece of code scene.graph[self.rigid_body] borrows rigid_body as either mutable or shared, depending on the context (basically it is just an implementation of Index + IndexMut traits). Once we've borrowed objects, we can modify them. As the next step we calculate new horizontal speed for the player: // Keep only vertical velocity, and drop horizontal.
let mut velocity = Vector3::new(0.0, body.lin_vel().y, 0.0); // Change the velocity depending on the keys pressed.
if self.controller.move_forward { // If we moving forward then add "look" vector of the body. velocity += body.look_vector();
}
if self.controller.move_backward { // If we moving backward then subtract "look" vector of the body. velocity -= body.look_vector();
}
if self.controller.move_left { // If we moving left then add "side" vector of the body. velocity += body.side_vector();
}
if self.controller.move_right { // If we moving right then subtract "side" vector of the body. velocity -= body.side_vector();
} // Finally new linear velocity.
body.set_lin_vel(velocity); We don't need to modify vertical speed, because it should be controlled by the physics engine. Finally, we're setting rotation of the rigid body: // Change the rotation of the rigid body according to current yaw. These lines responsible for
// left-right rotation.
body.local_transform_mut() .set_rotation(UnitQuaternion::from_axis_angle( &Vector3::y_axis(), self.controller.yaw.to_radians(), )); The next piece of code is a bit boring, but still should be addressed - it is input handling. In the process_input_event we check input events and configure input controller accordingly. Basically we're just checking if W, S, A, D keys were pressed or released. In the MouseMotion arm, we're modifying yaw and pitch of the controller according to mouse velocity. Nothing fancy, except this line: self.controller.pitch = (self.controller.pitch + delta.1 as f32).clamp(-90.0, 90.0); Here we're just restricting pitch to [-90; 90] degree range to not let flipping camera upside-down. Now let's run the game, you should see something like this and be able to walk and turn the camera. Controller

