use fyrox::scene::graph::Graph;
use fyrox::{ core::{algebra::Vector3, math::Vector3Ext, pool::Handle}, engine::resource_manager::ResourceManager, scene::{node::Node, Scene},
}; pub struct Weapon { model: Handle<Node>, shot_point: Handle<Node>, shot_timer: f32,
} impl Weapon { pub async fn new(scene: &mut Scene, resource_manager: ResourceManager) -> Self { // Yeah, you need only few lines of code to load a model of any complexity. let model = resource_manager .request_model("data/models/m4.fbx") .await .unwrap() .instantiate(scene); let shot_point = scene.graph.find_by_name(model, "Weapon:ShotPoint").unwrap().0; Self { model, shot_point, shot_timer: 0.0, } } pub fn model(&self) -> Handle<Node> { self.model } pub fn shot_point(&self) -> Handle<Node> { self.shot_point } pub fn update(&mut self, dt: f32) { self.shot_timer = (self.shot_timer - dt).min(0.0); } pub fn can_shoot(&self) -> bool { self.shot_timer <= 0.0 } pub fn shoot(&mut self) { self.shot_timer = 1.0; }
} This piece of code just loads a weapon model and saves an instance handle for further use. Also, each weapon should contain a helper node that tells from where it will "emit" bullets, the node was added in a 3D editor and has name Weapon:ShotPoint. Weapon implementation has helper methods that provide read-only access to inner fields (model, shot_point). update method just decreases the timer's value which is used to change the pace of shooting. You may ask "why shoot method just modifies timer's value and does not create bullets, etc.?" - please be patient, I will explain this later in game architecture section of the tutorial. OK, now we need to make a point where every weapon will be "mounted" on, go to Player::new and add these lines in the BaseBuilder of the CameraBuilder instance (you also need to import PivotBuilder): .with_children(&[{ weapon_pivot = PivotBuilder::new( BaseBuilder::new().with_local_transform( TransformBuilder::new() .with_local_position(Vector3::new( -0.1, -0.05, 0.015, )) .build(), ), ) .build(&mut scene.graph); weapon_pivot
}]), What is going on here? We're just adding new child node to the camera and offset it by some vector. Every weapon will be attached to this pivot. Please keep in mind that the offset given in local coordinates, which means that weapon pivot will move with the camera, but with some offset relative to it. Also, do not forget to add this line after let camera;: let weapon_pivot; Finally, add the weapon pivot to Self { ... } (and also add weapon_pivot: Handle<Node> to the Player struct): Self { camera, weapon_pivot, // <- here rigid_body: rigid_body_handle.into(), controller: Default::default(),
} Next we need a container for weapons, let's add it to the Game struct: struct Game { scene: Handle<Scene>, player: Player, weapons: Pool<Weapon> // Weapons will live in a pool
} Also do not forget to import Pool from fyrox::core::pool in main.rs: ...
use fyrox::core::pool::{Handle, Pool};
... Now we need to change Game::new() a bit to add a weapon to the player: pub async fn new(engine: &mut Engine) -> Self { let mut scene = Scene::new(); // Load a scene resource and create its instance. engine .resource_manager .request_model("data/models/scene.rgs") .await .unwrap() .instantiate(&mut scene); // Create player first. let player = Player::new(&mut scene, engine.resource_manager.clone()).await; // Create weapon next. let weapon = Weapon::new(&mut scene, engine.resource_manager.clone()).await; // "Attach" the weapon to the weapon pivot of the player. scene.graph.link_nodes(weapon.model(), player.weapon_pivot); // Create a container for the weapons. let mut weapons = Pool::new(); // Put the weapon into it. weapons.spawn(weapon); Self { player, scene: engine.scenes.add(scene), weapons, }
} At first, we're loading the scene, next we're creating player as usual. Next we're creating a weapon and attach it to the weapon pivot we've made earlier. Finally, we're creating a container for the weapons: we'll use Pool to be able to borrow weapon later on when we need. So, let's run the game, and you should see something like this: Weapon Alright, now we have a weapon, but it still can't shoot. Let's fix that.

