let weapon = weapons.spawn(weapon); // "Give" the weapon to the player.
player.weapon = weapon; ... Finally, at the end of Player::update we will handle the state of the input controller: if self.controller.shoot { self.sender .send(Message::ShootWeapon { weapon: self.weapon, }) .unwrap();
} Ok, at this momemt you should be able to compile the game and as you run it, you should see something like this when you'll press left mouse button: Weapon Barrels should react to shots as in the video at the beginning of the tutorial.

