Let's start from definition of animation. Animation is a set of tracks, where each track responsible for animation of a single node and contains key frames placed on a timeline with some transition rules between key frames. Animation usually changes just position/rotation/scale of a node. When animation is playing it calculates intermediate values for each parameter using interpolation techniques (linear and spherical interpolation). Animations in general is very simple and powerful technique, but at many times it still does not enough. If you will just switch multiple animations from one to one, it will look very bad and unnatural. This is where animation blending machines come into play. Weapon Fyrox provides very powerful mechanism for animations - animation blending machines. If you're already familiar with Mecanim in Unity game engine or similar thing in Unreal Engine, then you'll probably already understood what will be in this paragraph. Animation blending machine (ABM) is a state machine that allows you to blend multiple animations in one and apply it to a set of bones (or nodes in general). ABM is a graph where each node is a state, each state has a source of animation pose which in its turn may be another subgraph of pose emitting nodes. States connected between each other using transition edges which have some parameters like transition time, a rule for transition, etc. At each moment of time either state or transition can be active. In other words this means that ABM is either transitioning from a state to state or hold a state. This leads to another fact - ABM cannot jump from a state to state if they're not connected with transition edge. ABMs in general can be represented like this: Weapon States are marked yellow, animation nodes - blue, animations - green. As you can see there can be multiple transitions between states, each transition has corresponding Rule parameter which is a simple boolean value which tells a machine when it is possible to start transition. Each state is supplied with animation node (PlayAnimation, BlendAnimations, BlendAnimationsByIndex, etc.) which does exactly what the name states. PlayAnimation just plays given animation, BlendAnimations - blends multiple animations with different weights into one, BlendAnimationsByIndex - blends multiple animations as the BlendAnimations, but each animation has transition time, and the node uses an index parameter to switch between attached animations. Please keep in mind that BlendAnimations node can have various sources of pose, as you can see in the picture, it uses two PlayAnimation nodes as source of poses, but nothing keeps you from adding new pose source which will be yet another BlendAnimations. So everything depends on your needs and ABM just gives you enough flexibility. Ok, back to the game. Let's create a simple ABM for bots. For simplicity, it will contain only three states - Idle, Walk, Attack. Put this code somewhere at the end of bot.rs: // Simple helper method to create a state supplied with PlayAnimation node.
fn create_play_animation_state( animation_resource: Model, name: &str, layer: &mut MachineLayer, scene: &mut Scene, model: Handle<Node>,
) -> (Handle<Animation>, Handle<State>) { // Animations retargetting just makes an instance of animation and binds it to // given model using names of bones. let animation = *animation_resource .retarget_animations(model, &mut scene.graph) .get(0) .unwrap(); // Create new PlayAnimation node and add it to machine. let node = layer.add_node(PoseNode::make_play_animation(animation)); // Make a state using the node we've made. let state = layer.add_state(State::new(name, node)); (animation, state)
} pub struct BotAnimationMachineInput { // Whether a bot is walking or not. pub walk: bool, // Whether a bot is attacking or not. pub attack: bool,
} pub struct BotAnimationMachine { animation_player: Handle<Node>, machine: Machine,
} impl BotAnimationMachine { // Names of parameters that will be used for transition rules in machine. const IDLE_TO_WALK: &'static str = "IdleToWalk"; const WALK_TO_IDLE: &'static str = "WalkToIdle"; const WALK_TO_ATTACK: &'static str = "WalkToAttack"; const IDLE_TO_ATTACK: &'static str = "IdleToAttack"; const ATTACK_TO_IDLE: &'static str = "AttackToIdle"; const ATTACK_TO_WALK: &'static str = "AttackToWalk"; pub async fn new( scene: &mut Scene, model: Handle<Node>, resource_manager: ResourceManager, ) -> Self { let animation_player = AnimationPlayerBuilder::new(BaseBuilder::new()).build(&mut scene.graph); scene.graph.link_nodes(animation_player, model); let mut machine = Machine::new(); let root = machine.layers_mut().first_mut().unwrap(); // Load animations in parallel. let (walk_animation_resource, idle_animation_resource, attack_animation_resource) = fyrox::core::futures::join!( resource_manager.request_model("data/animations/zombie_walk.fbx"), resource_manager.request_model("data/animations/zombie_idle.fbx"), resource_manager.request_model("data/animations/zombie_attack.fbx"), ); // Now create three states with different animations. let (_, idle_state) = create_play_animation_state( idle_animation_resource.unwrap(), "Idle", root, scene, model, ); let (walk_animation, walk_state) = create_play_animation_state( walk_animation_resource.unwrap(), "Walk", root, scene, model, ); let (attack_animation, attack_state) = create_play_animation_state( attack_animation_resource.unwrap(), "Attack", root, scene, model, ); // Next, define transitions between states. root.add_transition(Transition::new( // A name for debugging. "Idle->Walk", // Source state. idle_state, // Target state. walk_state, // Transition time in seconds. 0.4, // A name of transition rule parameter. Self::IDLE_TO_WALK, )); root.add_transition(Transition::new( "Walk->Idle", walk_state, idle_state, 0.4, Self::WALK_TO_IDLE, )); root.add_transition(Transition::new( "Walk->Attack", walk_state, attack_state, 0.4, Self::WALK_TO_ATTACK, )); root.add_transition(Transition::new( "Idle->Attack", idle_state, attack_state, 0.4, Self::IDLE_TO_ATTACK, )); root.add_transition(Transition::new( "Attack->Idle", attack_state, idle_state, 0.4, Self::ATTACK_TO_IDLE, )); root.add_transition(Transition::new( "Attack->Walk", attack_state, walk_state, 0.4, Self::ATTACK_TO_WALK, )); // Define entry state. root.set_entry_state(idle_state); Self { animation_player, machine, } } pub fn update(&mut self, scene: &mut Scene, dt: f32, input: BotAnimationMachineInput) { let animation_player = scene.graph[self.animation_player] .query_component_ref::<AnimationPlayer>() .unwrap(); self.machine // Set transition parameters. .set_parameter(Self::WALK_TO_IDLE, Parameter::Rule(!input.walk)) .set_parameter(Self::IDLE_TO_WALK, Parameter::Rule(input.walk)) .set_parameter(Self::WALK_TO_ATTACK, Parameter::Rule(input.attack)) .set_parameter(Self::IDLE_TO_ATTACK, Parameter::Rule(input.attack)) .set_parameter(Self::ATTACK_TO_IDLE, Parameter::Rule(!input.attack)) .set_parameter(Self::ATTACK_TO_WALK, Parameter::Rule(!input.attack)) // Update machine and evaluate final pose. .evaluate_pose(animation_player.animations(), dt) // Apply the pose to the graph. .apply(&mut scene.graph); }
} Ok, this might be the biggest heap of code we've ever been dealing with at once. There is lots of stuff happening, let's thoroughly "scan" this code. It starts from the simple helper method to create states: // Simple helper method to create a state supplied with PlayAnimation node.
fn create_play_animation_state( animation_resource: Model, name: &str, layer: &mut MachineLayer, scene: &mut Scene, model: Handle<Node>,
) -> (Handle<Animation>, Handle<State>) { // Animations retargetting just makes an instance of animation and binds it to // given model using names of bones. let animation = *animation_resource .retarget_animations(model, &mut scene.graph) .get(0) .unwrap(); // Create new PlayAnimation node and add it to machine. let node = layer.add_node(PoseNode::make_play_animation(animation)); // Make a state using the node we've made. let state = layer.add_state(State::new(name, node)); (animation, state)
} Here we're using new method of Model resource - retarget_animations , in short, it creates an instance of animation, and binds animations tracks to nodes in given sub graph that starts from a node given as first parameter. Next we're adding a PlayAnimation node to machine and making a new state node. Now we're adding a structure with input parameter for ABM: pub struct BotAnimationMachineInput { // Whether a bot is walking or not. pub walk: bool, // Whether a bot is attacking or not. pub attack: bool,
} This structure will contain more flags in the future, but now on to BotAnimationMachine::new(). At first, we're creating new ABM instance, nothing fancy here. Next we're loading animations in parallel: let mut machine = Machine::new(); // Load animations in parallel.
let (walk_animation_resource, idle_animation_resource, attack_animation_resource) = fyrox::core::futures::join!( resource_manager.request_model("data/animations/zombie_walk.fbx"), resource_manager.request_model("data/animations/zombie_idle.fbx"), resource_manager.request_model("data/animations/zombie_attack.fbx"),
); As you may have noticed, there is no difference between animation resource and model resource, this is because any 3D model can have animations. The animations we're loading, contain only bones and key frames for them, but not mesh of a bot. We simply don't need a mesh, because we've already created the mesh earlier. This separation of animations and mesh is very handy, because it saves CPU cycles and disk space. Ok, next we're creating states for ABM: // Now create three states with different animations.
let (_, idle_state) = create_play_animation_state( idle_animation_resource.unwrap(), "Idle", root, scene, model,
); let (walk_animation, walk_state) = create_play_animation_state( walk_animation_resource.unwrap(), "Walk", root, scene, model,
); let (attack_animation, attack_state) = create_play_animation_state( attack_animation_resource.unwrap(), "Attack", root, scene, model,
); These states are those yellow-ish rectangles on diagram up above. As you can see we're creating three states: idle, walk, attack. Next we need to connect states between each other. // Next, define transitions between states.
root.add_transition(Transition::new( // A name for debugging. "Idle->Walk", // Source state. idle_state, // Target state. walk_state, // Transition time in seconds. 0.4, // A name of transition rule parameter. Self::IDLE_TO_WALK,
)); ... // Rest are intentionally omitted Ok, comments should clarify what is going on here, but one thing I want to mention specifically. As you may have noticed, transition is that black arrow on the diagram up above, and it is linked with a parameter. Parameter have a name, and as you'll see later the name will be used to modify parameters. Finally, we're setting entry state to idle and return ABM instance: // Define entry state.
machine.set_entry_state(idle_state); Self { machine } Now for another important part, we have to "feed" machine with actual parameters for each transition: pub fn update(&mut self, scene: &mut Scene, dt: f32, input: BotAnimationMachineInput) { let animation_player = scene.graph[self.animation_player] .query_component_ref::<AnimationPlayer>() .unwrap(); self.machine // Set transition parameters. .set_parameter(Self::WALK_TO_IDLE, Parameter::Rule(!input.walk)) .set_parameter(Self::IDLE_TO_WALK, Parameter::Rule(input.walk)) .set_parameter(Self::WALK_TO_ATTACK, Parameter::Rule(input.attack)) .set_parameter(Self::IDLE_TO_ATTACK, Parameter::Rule(input.attack)) .set_parameter(Self::ATTACK_TO_IDLE, Parameter::Rule(!input.attack)) .set_parameter(Self::ATTACK_TO_WALK, Parameter::Rule(!input.attack)) // Update machine and evaluate final pose. .evaluate_pose(animation_player.animations(), dt) // Apply the pose to the graph. .apply(&mut scene.graph);
} Here we're setting each transition rule one by one, then forcing machine to evaluate animation pose and apply it to the graph. You may ask how machine knows which nodes (bones) should be affected? Remember what was the definition of animation and its tracks? Right, each track knows about the node it affects, animation blending machine just combines multiple sources of poses into one and animation for same node blends into a final pose and final pose contains animation for each node that was used in all tracks used in ABM. Next we need to use the machine we've made. Add a new field to Bot: machine: BotAnimationMachine and initialize it in "constructor": Self { machine: BotAnimationMachine::new(scene, model, resource_manager).await, ...
} Next we need to update machine, add following method to impl Bot: pub fn update(&mut self, scene: &mut Scene, dt: f32) { // For now these are set to false which will force bot to be in idle state. let input = BotAnimationMachineInput { walk: false, attack: false, }; self.machine.update(scene, dt, input);
} This method will update machine and "feed" it with actual state, for now the state has flags combination that forces bot to be in idle state. This will be fixed when we'll add simple AI later in this tutorial. Finally, we need to update each bot we have, go to Game::update and add following lines there (somewhere after update of weapons): for bot in self.bots.iter_mut() { bot.update(scene, dt);
} Now run the game, and you should see that bots now is in idle state and animation is playing, it should look like this: Weapon

