Ok, now we have to use ABM we've made at full capacity, to do that we'll write simple AI - bot will just follow player in a straight line and attack if they're close enough. Let's start by modifying Bot::update: pub fn update(&mut self, scene: &mut Scene, dt: f32, target: Vector3<f32>) { let attack_distance = 0.6; // Simple AI - follow target by a straight line. let self_position = scene.graph[self.rigid_body].global_position(); let direction = target - self_position; // Distance to target. let distance = direction.norm(); if distance != 0.0 && distance < 1.5 { self.follow_target = true; } if self.follow_target && distance != 0.0 { let rigid_body = scene.graph[self.rigid_body].as_rigid_body_mut(); // Make sure bot is facing towards the target. rigid_body .local_transform_mut() .set_rotation(UnitQuaternion::face_towards( &Vector3::new(direction.x, 0.0, direction.z), &Vector3::y_axis(), )); // Move only if we're far enough from the target. if distance > attack_distance { // Normalize direction vector and scale it by movement speed. let xz_velocity = direction.scale(1.0 / distance).scale(0.9); let new_velocity = Vector3::new(xz_velocity.x, rigid_body.lin_vel().y, xz_velocity.z); rigid_body.set_lin_vel(new_velocity); } } // For now these are set to false which will force bot to be in idle state. let input = BotAnimationMachineInput { walk: self.follow_target && distance > attack_distance, attack: distance < attack_distance, }; self.machine.update(scene, dt, input);
} Also add a new field to Player: follow_target: bool and initialize it in the constructor: Self { follow_target: false, ...
} So, the AI algorithm is very simple - stand still until a target (player) come closer, once it's close enough, switch follow_target flag to true and begin to follow the target. To do that, all we have to do is to find a vector between target and position of a bot, make sure bots is facing towards the target and move it if it is far enough. So let's begin digging the code: let attack_distance = 0.6; // Simple AI - follow target by a straight line.
let self_position = scene.graph[self.pivot].global_position();
let direction = target - self_position; // Distance to target.
let distance = direction.norm(); if distance != 0.0 && distance < 1.5 { self.follow_target = true;
} At the beginning we define a melee attack distance, bot will attack target only if it close enough. Next, we're building vector to from bot's position to target, calculate distance by taking length of the vector and check if we should switch follow_target flag. Next goes the most interesting parts of the AI: if self.follow_target && distance != 0.0 { let rigid_body = scene.graph[self.rigid_body].as_rigid_body_mut(); // Make sure bot is facing towards the target. rigid_body .local_transform_mut() .set_rotation(UnitQuaternion::face_towards( &Vector3::new(direction.x, 0.0, direction.z), &Vector3::y_axis(), )); ... Here we just borrow rigid body a bot, and make sure it rotated towards the target. Next we're moving bot if it is far enough from the target: ... // Move only if we're far enough from the target. if distance > attack_distance { // Normalize direction vector and scale it by movement speed. let xz_velocity = direction.scale(1.0 / distance).scale(0.9); let new_velocity = Vector3::new(xz_velocity.x, rigid_body.lin_vel().y, xz_velocity.z); rigid_body.set_lin_vel(new_velocity); }
} This part is pretty simple too, all we have to do is to check how far the bot is, normalize direction vector, scale it by movement speed and form new velocity vector using new XZ velocity + current Y velocity of a bot to preserve velocity added by gravity (otherwise bot would just fly, you can experiment with this part to make flying zombies). One last thing before we build and run the game, change lines of how we're updating bots to following lines: let target = scene.graph[self.player.pivot].global_position(); for bot in self.bots.iter_mut() { bot.update(scene, dt, target);
} As you can see, here we're using player's position as target. In future tutorials we'll improve AI to be able to automatically select targets to attack. Also, we'll "teach" bots to use weapons. Now it's the time to build and run the game and you should see something like this (something like in the video at the beginning of the tutorial): Weapon

