Now we can start adding Player to our game. Create a folder player under your src directory and add mod.rs with following content: # extern crate fyrox; # #[cfg(test)]
use crate::player::camera::CameraController; // Import everything we need for the tutorial.
use fyrox::{ animation::{ machine::{Machine, MachineLayer, Parameter, PoseNode, State, Transition}, Animation, }, core::{ algebra::{UnitQuaternion, Vector3}, pool::Handle, }, engine::resource_manager::ResourceManager, event::{DeviceEvent, ElementState, KeyboardInput, VirtualKeyCode}, resource::model::Model, scene::{ animation::AnimationPlayer, base::BaseBuilder, collider::{ColliderBuilder, ColliderShape}, graph::{Graph, physics::CoefficientCombineRule}, node::Node, rigidbody::RigidBodyBuilder, transform::TransformBuilder, Scene, },
}; # #[cfg(test)]
mod camera; # struct CameraController;
# impl CameraController {
# async fn new(_: &mut Graph, _: ResourceManager) -> Self { Self }
# } pub struct Player { model: Handle<Node>, camera_controller: CameraController,
} impl Player { pub async fn new(resource_manager: ResourceManager, scene: &mut Scene) -> Self { // Load paladin 3D model and create its instance in the scene. let model = resource_manager .request_model("data/models/paladin/paladin.fbx") .await .unwrap() .instantiate(scene); scene.graph[model] .local_transform_mut() // Move the model a bit down because its center is at model's feet // and we'd get floating model without this offset. .set_position(Vector3::new(0.0, -0.75, 0.0)) // Scale down paladin's model because it is too big. .set_scale(Vector3::new(0.02, 0.02, 0.02)); Self { model, // As a final stage create camera controller. camera_controller: CameraController::new(&mut scene.graph, resource_manager).await, } }
} Let's disassemble this heap of code line by line. At first, we're creating pivot for our character, we'll use it as a "mounting point" for character's 3D model, also it will have a physical body, but that will be added later in this tutorial. Next, we're loading paladin 3D model and creating its instance in the scene, we need only geometry without animations, so we use instantiate_geometry here, animations will be added later in this tutorial. Next we scale the model a bit, because it is too big. Also, we're moving the model a bit down because its center is at paladin's feet so when we're attaching the model to the pivot, it will "stay" on the pivot. We want it to stay on ground, so we're moving it down by height of the model. Finally, we're attaching the model to the pivot, forcing the engine to move the model together with pivot. In the end we're creating camera controller, it needs its own module, so add camera.rs module under src/player with following content: # extern crate fyrox;
// Import everything we need for the tutorial.
use fyrox::{ core::{ algebra::{UnitQuaternion, Vector3}, pool::Handle, }, engine::resource_manager::ResourceManager, event::DeviceEvent, resource::texture::TextureWrapMode, scene::{ base::BaseBuilder, camera::{CameraBuilder, SkyBox, SkyBoxBuilder}, graph::Graph, node::Node, transform::TransformBuilder, pivot::PivotBuilder },
}; async fn create_skybox(resource_manager: ResourceManager) -> SkyBox { // Load skybox textures in parallel. let (front, back, left, right, top, bottom) = fyrox::core::futures::join!( resource_manager.request_texture("data/textures/skybox/front.jpg"), resource_manager.request_texture("data/textures/skybox/back.jpg"), resource_manager.request_texture("data/textures/skybox/left.jpg"), resource_manager.request_texture("data/textures/skybox/right.jpg"), resource_manager.request_texture("data/textures/skybox/up.jpg"), resource_manager.request_texture("data/textures/skybox/down.jpg") ); // Unwrap everything. let skybox = SkyBoxBuilder { front: Some(front.unwrap()), back: Some(back.unwrap()), left: Some(left.unwrap()), right: Some(right.unwrap()), top: Some(top.unwrap()), bottom: Some(bottom.unwrap()), } .build() .unwrap(); // Set S and T coordinate wrap mode, ClampToEdge will remove any possible seams on edges // of the skybox. let cubemap = skybox.cubemap(); let mut data = cubemap.as_ref().unwrap().data_ref(); data.set_s_wrap_mode(TextureWrapMode::ClampToEdge); data.set_t_wrap_mode(TextureWrapMode::ClampToEdge); skybox
} pub struct CameraController { pivot: Handle<Node>, hinge: Handle<Node>, camera: Handle<Node>,
} impl CameraController { pub async fn new(graph: &mut Graph, resource_manager: ResourceManager) -> Self { let camera; let hinge; let pivot = PivotBuilder::new(BaseBuilder::new() .with_children(&[{ hinge = PivotBuilder::new(BaseBuilder::new() .with_local_transform( TransformBuilder::new() .with_local_position(Vector3::new(0.0, 0.55, 0.0)) .build(), ) .with_children(&[{ camera = CameraBuilder::new( BaseBuilder::new().with_local_transform( TransformBuilder::new() .with_local_position(Vector3::new(0.0, 0.0, -2.0)) .build(), ), ) .with_z_far(48.0) .with_skybox(create_skybox(resource_manager).await) .build(graph); camera }])) .build(graph); hinge }])) .build(graph); Self { pivot, hinge, camera, } }
} To understand what this code does let's look closely at this picture: Camera Layout The pivot is marked yellow here, the hinge - green, and finally the camera is just a trapeze. Lines with arrows shows how the nodes linked together. As you can see we're attaching the hinge to the pivot and move it up slightly (usually to the height of the character). Next we're attaching the camera to the hinge and move it back so in default position it will be behind the character. To understand why we need such layout, let's find out how we need to move and rotate the camera. We need to rotate the camera around imaginary axis that goes through hinge ("in" the screen on the picture) - in this layout the camera will always look at character's head and rotate around local hinge's X axis. So to do that we need to rotate the hinge around X axis, not the camera. Here's the picture to help your understanding this better. Camera Layout That was just one of the axes, now we need to understand how to rotate the camera around Y axis, but preserving the rotation around X axis. This is very simple, we have the pivot for that. Remember that each of the nodes (pivot, hinge, camera) are linked together, so if we'll rotate the pivot around Y axis the hinge will rotate too as well as the camera. Fow now our camera controller does not have an ability to rotate, we'll add this later in the tutorial. Now let's load a level where our character will "live", add level.rs with following content: # extern crate fyrox;
use fyrox::{ core::pool::Handle, engine::resource_manager::{ResourceManager}, scene::{node::Node, Scene},
}; pub struct Level { root: Handle<Node>,
} impl Level { pub async fn new(resource_manager: ResourceManager, scene: &mut Scene) -> Self { let root = resource_manager .request_model("data/levels/level.rgs") .await .unwrap() .instantiate(scene); Self { root } }
} This small piece of code just loads the scene I made for this tutorial. It has a terrain and some decorations, including houses, trees, bushes, barrels, etc. The scene was made in the Fyroxed and can be freely edited without any problems. Just open the scene and modify it as you need. Now we need to "glue" all the pieces (the player, and the level) together, let's go back to main.rs and change it to the following code: # extern crate fyrox;
# #[cfg(test)]
use crate::{level::Level, player::Player};
use fyrox::{ core::{color::Color, futures::executor::block_on, pool::Handle}, engine::{resource_manager::ResourceManager, executor::Executor}, event::{Event, WindowEvent}, event_loop::ControlFlow, plugin::{Plugin, PluginConstructor, PluginContext}, scene::{Scene},
}; # #[cfg(test)]
mod level;
# #[cfg(test)]
mod player; # struct Player;
# impl Player {
# async fn new(_: ResourceManager, _: &mut Scene) -> Self { Self }
# } # struct Level;
# impl Level {
# async fn new(_: ResourceManager, _: &mut Scene) -> Self { Self }
# } struct Game { scene: Handle<Scene>, level: Level, player: Player,
} struct GameConstructor; impl PluginConstructor for GameConstructor { fn create_instance(&self, _: Handle<Scene>, context: PluginContext) -> Box<dyn Plugin> { Box::new(Game::new(context)) }
} impl Game { fn new(context: PluginContext) -> Self { let mut scene = Scene::new(); scene.ambient_lighting_color = Color::opaque(150, 150, 150); let player = block_on(Player::new(context.resource_manager.clone(), &mut scene)); Self { player, level: block_on(Level::new(context.resource_manager.clone(), &mut scene)), scene: context.scenes.add(scene), } }
} impl Plugin for Game { fn update(&mut self, context: &mut PluginContext, _: &mut ControlFlow) { } fn on_os_event( &mut self, event: &Event<()>, _context: PluginContext, _control_flow: &mut ControlFlow, ) { }
} fn main() { let mut executor = Executor::new(); executor.add_plugin_constructor(GameConstructor); executor.get_window().set_title("RPG"); executor.run();
} As you can see, everything is pretty straightforward: at first we're creating a new scene, set its ambient lighting to "daylight", next we're creating the player and the level. Finally, we're adding the scene to the engine and now if you run the game you should see something like this: Scene For now everything is static, let's fix that by adding the ability to move the character and rotate the camera.

