Let's start from the camera movement and rotation. We need two new fields in the CameraController: # struct Stub {
// An angle around local Y axis of the pivot.
yaw: f32,
// An angle around local X axis of the hinge.
pitch: f32,
# } Do not forget to initialize them with zeros: Self { ..., yaw: 0.0, pitch: 0.0,
} Now we need to handle device events coming from the OS to rotate the camera. Add following method to the impl CameraController: pub fn handle_device_event(&mut self, device_event: &DeviceEvent) { if let DeviceEvent::MouseMotion { delta } = device_event { const MOUSE_SENSITIVITY: f32 = 0.015; self.yaw -= (delta.0 as f32) * MOUSE_SENSITIVITY; self.pitch = (self.pitch + (delta.1 as f32) * MOUSE_SENSITIVITY) // Limit vertical angle to [-90; 90] degrees range .max(-90.0f32.to_radians()) .min(90.0f32.to_radians()); }
} In this method we use only MouseMotion events, because CameraController does not move - it can only rotate. The method is pretty straightforward. We're changing yaw and pitch using mouse offsets in two axes. X axis changes yaw, Y axis changes pitch. Pitch should be limited in specific range to prevent camera to rotate 360 degrees around object, we need angle to be in [-90; 90] range. Once we've changed yaw and pitch, we need to apply rotations to the hinge and the camera. To do that, we need to add a new method to the impl CameraController: pub fn update(&mut self, graph: &mut Graph) { // Apply rotation to the pivot. graph[self.pivot] .local_transform_mut() .set_rotation(UnitQuaternion::from_axis_angle( &Vector3::y_axis(), self.yaw, )); // Apply rotation to the hinge. graph[self.hinge] .local_transform_mut() .set_rotation(UnitQuaternion::from_axis_angle( &Vector3::x_axis(), self.pitch, ));
} It is a very simple method, it borrows nodes, and applies rotations around specific axes. Now we need to call those two methods from somewhere. The most suitable place is impl Player, because Player owns an instance of CameraController: pub fn handle_device_event(&mut self, device_event: &DeviceEvent) { self.camera_controller.handle_device_event(device_event)
} pub fn update(&mut self, scene: &mut Scene) { self.camera_controller.update(&mut scene.graph);
} For now both methods are just proxies, but it will be changed pretty soon. Now we need to call the proxies, but from where? The most suitable place is on_tick and on_device_event of the GameState trait implementation for our Game structure: fn on_tick(&mut self, engine: &mut Engine, dt: f32, _control_flow: &mut ControlFlow) { let scene = &mut engine.scenes[self.scene]; self.player.update(scene);
} fn on_device_event( &mut self, _engine: &mut Engine, _device_id: DeviceId, event: DeviceEvent,
) { self.player.handle_device_event(&event);
} Now you can run the game, and the camera should rotate when you're moving your mouse. Now it's the time to add an ability to walk for our character.

432.body:
Our player still can't move, in this section we'll fix it. Player's movement for third person camera differs from the movement of first person. For the third person camera we must move the player either where the camera looks or according to pressed keys on the keyboard. Let's start by adding input controller, it will hold info about needed movement: #[derive(Default)]
struct InputController { walk_forward: bool, walk_backward: bool, walk_left: bool, walk_right: bool,
} Add new field to the Player: input_controller: InputController, And initialize it with Default::default in the Player::new: Self { ..., input_controller: Default::default(),
} Now we need to change the state of the input controller, to do that we'll use keyboard events. Add following method to the impl Player: pub fn handle_key_event(&mut self, key: &KeyboardInput) { if let Some(key_code) = key.virtual_keycode { match key_code { VirtualKeyCode::W => { self.input_controller.walk_forward = key.state == ElementState::Pressed } VirtualKeyCode::S => { self.input_controller.walk_backward = key.state == ElementState::Pressed } VirtualKeyCode::A => { self.input_controller.walk_left = key.state == ElementState::Pressed } VirtualKeyCode::D => { self.input_controller.walk_right = key.state == ElementState::Pressed } _ => (), } }
} Now we need to call this method, we'll do it from on_window_event in the GameState trait implementation for our Game: fn on_window_event(&mut self, _engine: &mut Engine, event: WindowEvent) { match event { WindowEvent::KeyboardInput { input, .. } => { self.player.handle_key_event(&input); } _ => (), }
} Ok, now we have input controller functioning. Now we can start adding movement logic to the player. Let's start by adding a physical body to the player. We'll use a capsule rigid body with locked rotations for that. Add these lines somewhere in Player::new: # extern crate fyrox;
# use fyrox::{
# core::algebra::Vector3,
# core::pool::Handle,
# scene::{
# Scene,
# base::BaseBuilder,
