# } Now, once our character has physical body, we can move it. Add these lines to the end of Player::update: let body = scene.graph[self.body].as_rigid_body_mut(); let look_vector = body .look_vector() .try_normalize(f32::EPSILON) .unwrap_or(Vector3::z()); let side_vector = body .side_vector() .try_normalize(f32::EPSILON) .unwrap_or(Vector3::x()); let position = **body.local_transform().position(); let mut velocity = Vector3::default(); if self.input_controller.walk_right { velocity -= side_vector;
}
if self.input_controller.walk_left { velocity += side_vector;
}
if self.input_controller.walk_forward { velocity += look_vector;
}
if self.input_controller.walk_backward { velocity -= look_vector;
} let speed = 1.35 * dt;
let velocity = velocity .try_normalize(f32::EPSILON) .and_then(|v| Some(v.scale(speed))) .unwrap_or(Vector3::default()); // Apply linear velocity.
body.set_lin_vel(Vector3::new( velocity.x / dt, body.lin_vel().y, velocity.z / dt,
)); let is_moving = velocity.norm_squared() > 0.0;
