At this point our character can move, and we can rotate the camera around it, but the character is still in T-pose and does not have any animation. In this section we'll animate it. To keep this tutorial at reasonable length, we'll add just an idle and walk animations and smooth transitions between them. Add following code at the end of player.rs: # extern crate fyrox;
# use fyrox::{
# animation::{
# machine::{Machine, MachineLayer, Parameter, PoseNode, State, Transition},
# Animation,
# },
# core::pool::Handle,
# engine::resource_manager::ResourceManager,
# resource::model::Model,
# scene::{node::Node, animation::AnimationPlayer, Scene},
# }; // Simple helper method to create a state supplied with PlayAnimation node.
fn create_play_animation_state( animation_resource: Model, name: &str, layer: &mut MachineLayer, scene: &mut Scene, model: Handle<Node>,
) -> (Handle<Animation>, Handle<State>) { // Animations retargetting just makes an instance of animation and binds it to // given model using names of bones. let animation = *animation_resource .retarget_animations(model, &mut scene.graph) .get(0) .unwrap(); // Create new PlayAnimation node and add it to machine. let node = layer.add_node(PoseNode::make_play_animation(animation)); // Make a state using the node we've made. let state = layer.add_state(State::new(name, node)); (animation, state)
} pub struct AnimationMachineInput { // Whether a bot is walking or not. pub walk: bool,
} pub struct AnimationMachine { machine: Machine, animation_player: Handle<Node>,
} impl AnimationMachine { // Names of parameters that will be used for transition rules in machine. const IDLE_TO_WALK: &'static str = "IdleToWalk"; const WALK_TO_IDLE: &'static str = "WalkToIdle"; pub async fn new( scene: &mut Scene, model: Handle<Node>, resource_manager: ResourceManager, ) -> Self { let animation_player = scene.graph.find(model, &mut |n| { n.query_component_ref::<AnimationPlayer>().is_some() }).unwrap().0; let mut machine = Machine::new(); let root = machine.layers_mut().first_mut().unwrap(); // Load animations in parallel. let (walk_animation_resource, idle_animation_resource) = fyrox::core::futures::join!( resource_manager.request_model("data/models/paladin/walk.fbx"), resource_manager.request_model("data/models/paladin/idle.fbx"), ); // Now create two states with different animations. let (_, idle_state) = create_play_animation_state( idle_animation_resource.unwrap(), "Idle", root, scene, model, ); let (walk_animation, walk_state) = create_play_animation_state( walk_animation_resource.unwrap(), "Walk", root, scene, model, ); // Next, define transitions between states. root.add_transition(Transition::new( // A name for debugging. "Idle->Walk", // Source state. idle_state, // Target state. walk_state, // Transition time in seconds. 0.4, // A name of transition rule parameter. Self::IDLE_TO_WALK, )); root.add_transition(Transition::new( "Walk->Idle", walk_state, idle_state, 0.4, Self::WALK_TO_IDLE, )); // Define entry state. root.set_entry_state(idle_state); Self { machine, animation_player, } } pub fn update(&mut self, scene: &mut Scene, dt: f32, input: AnimationMachineInput) { let animation_player = scene.graph[self.animation_player] .query_component_ref::<AnimationPlayer>() .unwrap(); self.machine // Set transition parameters. .set_parameter(Self::WALK_TO_IDLE, Parameter::Rule(!input.walk)) .set_parameter(Self::IDLE_TO_WALK, Parameter::Rule(input.walk)) // Update machine and evaluate final pose. .evaluate_pose(animation_player.animations(), dt) // Apply the pose to the graph. .apply(&mut scene.graph); }
} This is a simple animation blending machine, for more info check "Animations" section of "Writing a 3D shooter using Fyrox #3" tutorial, it has detailed explanation how animation blending machines work. In short, here we're loading two animations, and create two transitions between them and then applying final pose to the character. Now we need to create an instance of the AnimationMachine, add a field to the Player: ...,
animation_machine: AnimationMachine, And initialize it in the Player::new, before camera_controller: ...,
animation_machine: AnimationMachine::new(scene, model, resource_manager.clone()).await,
... The last thing we need to do is to update animation machine each frame, we'll do this in Player::update, at the end of the method: self.animation_machine .update(scene, dt, AnimationMachineInput { walk: is_moving }); Now if you run the game, you should see the character idling if not moving, and it should play "walking" animation if moving. That's it for this tutorial, in the next tutorial we'll "teach" the character to use swords.

