Our scene has pretty much everything we need to start adding scripts, we'll start from the Player script and make our character move. Navigate to game/src/lib.rs and at the end of the file add the following code snippet: # extern crate fyrox;
# use fyrox::{
# core::{
# uuid::{uuid, Uuid},
# reflect::prelude::*,
# visitor::prelude::*,
# },
# event::Event,
# impl_component_provider,
# gui::inspector::PropertyChanged,
# scene::node::TypeUuidProvider,
# script::{ScriptContext, ScriptTrait},
# };
#[derive(Visit, Reflect, Debug, Clone, Default)]
struct Player; impl_component_provider!(Player,); impl TypeUuidProvider for Player { // Returns unique script id for serialization needs. fn type_uuid() -> Uuid { uuid!("c5671d19-9f1a-4286-8486-add4ebaadaec") }
} impl ScriptTrait for Player { // Called once at initialization. fn on_init(&mut self, context: &mut ScriptContext) {} // Put start logic - it is called when every other script is already initialized. fn on_start(&mut self, context: &mut ScriptContext) { } // Called whenever there is an event from OS (mouse click, keypress, etc.) fn on_os_event(&mut self, event: &Event<()>, context: &mut ScriptContext) {} // Called every frame at fixed rate of 60 FPS. fn on_update(&mut self, context: &mut ScriptContext) {} // Returns unique script ID for serialization needs. fn id(&self) -> Uuid { Self::type_uuid() }
} This is a typical "skeleton" of any script, for now, its methods are pretty much empty, we'll fill it with actual code very soon. Let's go over the most important parts. The snippet starts from the Player structure definition which has #[derive(Visit, Inspect, Debug, Clone, Default)] attributes: Visit - implements serialization/deserialization functionality, it is used by the editor to save your object to a scene file. Inspect - generates metadata for the fields of your type - in other words, it allows the editor to "see" what's inside your structure and show additional information attached to the fields via proc-macro attributes. Reflect - implements compile-time reflection that allows the editor to mutate your objects. Debug - provides debugging functionality, it is mostly for the editor to let it print stuff into the console. Clone - makes your structure clone-able, why do we need this? We can clone objects, and we also want the script instance to be copied. Default implementation is very important - the scripting system uses it to create your scripts in the default state. This is necessary to set some data to it and so on. If it's a special case, you can always implement your own Default's implementation if it's necessary for your script. TypeUuidProvider is used to attach some unique id for your type, every script * must have a unique ID, otherwise, the engine will not be able to save and load your scripts. To generate a new UUID, use Online UUID Generator or any other tool that can generate UUIDs. Finally, we implement ScriptTrait for the Player. It has a bunch of methods, their names speak for themselves. Learn more about every method in documentation Before we can use the script in the editor, we must tell the engine that our script exists - we must register it. Remember that register method in the PluginConstructor trait implementation? It is exactly for script registration, replace its implementation with the following code snippet: fn register(&mut self, context: PluginRegistrationContext) { let script_constructors = &context.serialization_context.script_constructors; script_constructors.add::<Player>("Player");
} Now the engine knows about our script and will be able to use it. It is pretty much useless in the current state, but we can already assign it to the player. Select the player's rigid body node and find Script in the Inspector, select Player from the respective drop-down list and that's pretty much it - now the script is assigned: script_selection Let's learn how to edit script properties from the editor. In the next section, we'll be adding keyframe animation for your character, it is a perfect opportunity to learn how the engine and the editor operate with user-defined properties in scripts. To animate the player we need to get its sprite first. Let's start by adding the required field in the Player structure: #[derive(Visit, Reflect, Inspect, Debug, Clone, Default)]
struct Player { sprite: Handle<Node>,
} After adding this, the editor will be able to see the field and give you the ability to edit it in the Inspector. To assign the correct handle of the sprite to the respective field in script properties, hold Alt and start dragging the sprite node from the world viewer to the respective field in the player script. Release the mouse button and if everything is ok, the field should "say" something different than "Unassigned". Alright, at this point we know how to work with script properties, now we can start adding basic movement for the player. Go to the Player structure and add the following fields: # struct Foo {
move_left: bool,
move_right: bool,
jump: bool,
# } These fields will store the state of keyboard keys responsible for player movement. Now for on_os_event, add the following code there: if let Event::WindowEvent { event, .. } = event { if let WindowEvent::KeyboardInput { input, .. } = event { if let Some(keycode) = input.virtual_keycode { let is_pressed = input.state == ElementState::Pressed; match keycode { VirtualKeyCode::A => self.move_left = is_pressed, VirtualKeyCode::D => self.move_right = is_pressed, VirtualKeyCode::Space => self.jump = is_pressed, _ => (), } } }
} The code responds to OS events and modifies internal movement flags accordingly. Now we need to use the flags somehow, it's time for on_update. The method is called each frame and allows you to put game logic there: # extern crate fyrox;
# use fyrox::{core::algebra::Vector2, scene::dim2::rigidbody::RigidBody, script::ScriptContext};
# # struct Foo {
# move_left: bool,
# move_right: bool,
# jump: bool,
# }
# # impl Foo {
// Called every frame at fixed rate of 60 FPS.
fn on_update(&mut self, context: &mut ScriptContext) { // The script can be assigned to any scene node, but we assert that it will work only with // 2d rigid body nodes. if let Some(rigid_body) = context.scene.graph[context.handle].cast_mut::<RigidBody>() { let x_speed = match (self.move_left, self.move_right) { (true, false) => 3.0, (false, true) => -3.0, _ => 0.0, }; if self.jump { rigid_body.set_lin_vel(Vector2::new(x_speed, 4.0)); } else { rigid_body.set_lin_vel(Vector2::new(x_speed, rigid_body.lin_vel().y)); } }
}
# } Finally, some interesting code. At first, we check if the node to which the script is assigned is a 2d rigid body, next we're checking movement flags and form horizontal speed, and applying velocity to the body. Velocity is applied in two ways: if the jump button was pressed - apply horizontal velocity and some vertical velocity for jumping. If the jump button wasn't pressed - just change horizontal velocity - this will allow the player to free fall. Run the editor and enter play mode, press [A][D][Space] buttons to check if everything works correctly - the player should move horizontally and be able to jump. You can jump to the boxes on the right and push them off the ledge. The movement is working, but the player does not change orientation, if we'll go to the left - it looks ok (despite the lack of animation), but if we'll move to the right - it looks like the player moves backward. Let's fix that by changing the horizontal scaling of the player's sprite. Add the following code at the end of the if let ... block of the code above: // It is always a good practice to check whether the handles are valid, at this point we don't know
// for sure what's the value of the `sprite` field. It can be unassigned and the following code won't
// execute. A simple `context.scene.graph[self.sprite]` would just panicked in this case.
if let Some(sprite) = context.scene.graph.try_get_mut(self.sprite) { // We want to change player orientation only if he's moving. if x_speed != 0.0 { let local_transform = sprite.local_transform_mut(); let current_scale = **local_transform.scale(); local_transform.set_scale(Vector3::new( // Just change X scaling to mirror player's sprite. current_scale.x.copysign(-x_speed), current_scale.y, current_scale.z, )); }
} The comments should clarify what's going on here, but in short, we're changing the horizontal scaling of the player's sprite if the player is moving. The line current_scale.x.copysign(-x_speed) could be confusing, what it does? It replaces the sign of current horizontal scaling using the opposite sign of x_speed. Now if you run the game, the player will "look" in correct direction depending on the velocity vector.

