Sometimes you may need to temporarily extract an object from a pool, do something with it and then put it back while preserving handles to that object. There are three special methods for that: take_reserve + try_take_reserve - moves object out of the pool, but leaves the entry in "occupied" state. This function returns a tuple with two values (Ticket<T>, T). The latter value is obviously your object, but the former is more interesting. It is a special wrapper over object index that allows you to return the object back. It is used in put_back method. Caveat: an attempt to borrow moved object in the pool will cause panic! put_back - moves the object back in the pool using given ticket. Ticket says where to put the object in the pool. forget_ticket - makes the entry of the pool vacant again. It is useful in situations when you've moved object out of the pool, but for some reason you don't want to return it back in pool, in this case you must call this method, otherwise the corresponding entry will be unusable. Reservation example: # extern crate fyrox;
# use fyrox::core::pool::Pool;
#
# fn main() {
let mut pool = Pool::<u32>::new();
let handle = pool.spawn(1); let (ticket, ref mut obj) = pool.take_reserve(handle); *obj = 123; // Attempting to fetch while there is an existing reservation, will fail. let attempt_obj = pool.try_borrow(handle);
assert_eq!(attempt_obj, None); // Put back, allowing borrowing again. pool.put_back(ticket, *obj); let obj = pool.borrow(handle); assert_eq!(obj, &123);
# } Forget example: # extern crate fyrox;
# use fyrox::core::pool::Pool;
#
# fn main() {
let mut pool = Pool::<u32>::new();
let handle = pool.spawn(1); let (ticket, _obj) = pool.take_reserve(handle); pool.forget_ticket(ticket); let obj = pool.try_borrow(handle); assert_eq!(obj, None);
# }

