Plugin structure is defined by Plugin trait. Typical implementation can be generated by fyrox-template tool, and it looks something like this: # extern crate fyrox;
use fyrox::{ core::{ futures::executor::block_on, pool::Handle, }, event::Event, event_loop::ControlFlow, gui::message::UiMessage, plugin::{Plugin, PluginConstructor, PluginContext, PluginRegistrationContext}, scene::{Scene, SceneLoader},
}; pub struct GameConstructor; impl PluginConstructor for GameConstructor { fn register(&self, _context: PluginRegistrationContext) { // Register your scripts here. } fn create_instance( &self, override_scene: Handle<Scene>, context: PluginContext, ) -> Box<dyn Plugin> { Box::new(Game::new(override_scene, context)) }
} pub struct Game { scene: Handle<Scene>,
} impl Game { pub fn new(override_scene: Handle<Scene>, context: PluginContext) -> Self { let scene = if override_scene.is_some() { override_scene } else { // Load a scene from file if there is no override scene specified. let scene = block_on( block_on(SceneLoader::from_file( "data/scene.rgs", context.serialization_context.clone(), )) .unwrap() .finish(context.resource_manager.clone()), ); context.scenes.add(scene) }; Self { scene } }
} impl Plugin for Game { fn on_deinit(&mut self, _context: PluginContext) { // Do a cleanup here. } fn update(&mut self, _context: &mut PluginContext, _control_flow: &mut ControlFlow) { // Add your global update code here. } fn on_os_event( &mut self, _event: &Event<()>, _context: PluginContext, _control_flow: &mut ControlFlow, ) { // Do something on OS event here. } fn on_ui_message( &mut self, _context: &mut PluginContext, _message: &UiMessage, _control_flow: &mut ControlFlow, ) { // Handle UI events here. }
} There are two major parts - GameConstructor and Game itself. GameConstructor implements PluginConstructor and it is responsible for script registration (fn register) and creating the actual game instance (fn create_instance). register - called once on start allowing you to register your scripts. Important: You must register all your scripts here, otherwise the engine (and the editor) will know nothing about them. create_instance - called once, allowing you to create actual game instance. It is guaranteed to be called once, but where it is called is implementation-defined. For example, the editor will not call this method, it does not create any game instance. The method has override_scene parameter, in short it is a handle to a scene that must be used by your game instead of any other scenes. It is described in Editor and Plugins section down below. The game structure (struct Game) implements a Plugin trait which can execute actual game logic in one of its methods: on_deinit - it is called when the game is about to shut down. Can be used for any clean up, for example logging that the game has closed. update - it is called each frame at a stable rate (usually 60 Hz) after the plugin is created and fully initialized. It is the main place where you should put object-independent game logic, any other logic should be added via scripts. on_os_event - it is called when the main application window receives an event from the operating system, it can be any event such as keyboard, mouse, game pad events or any other events. Please note that as for update method, you should put here only object-independent logic. Scripts can catch window events too. on_ui_message - it is called when there is a message from the user interface, it should be used to react to user actions (like pressed buttons, etc.)

