Vast majority of methods accept PluginContext - it provides almost full access to engine entities, it has access to the renderer, scenes container, resource manager, user interface, main application window. Typical content of the context is something like this: # extern crate fyrox;
# use fyrox::{
# engine::{resource_manager::ResourceManager, SerializationContext},
# gui::UserInterface,
# renderer::Renderer,
# scene::SceneContainer,
# window::Window,
# };
# use std::sync::Arc;
pub struct PluginContext<'a, 'b> { pub scenes: &'a mut SceneContainer, pub resource_manager: &'a ResourceManager, pub user_interface: &'a mut UserInterface, pub renderer: &'a mut Renderer, pub dt: f32, pub lag: &'b mut f32, pub serialization_context: &'a Arc<SerializationContext>, pub window: &'a Window,
} scenes - a scene container, could be used to manage game scenes - add, remove, borrow. An example of scene loading is given in the previous code snippet in Game::new() method. resource_manager - is used to load external resources (scenes, models, textures, animations, sound buffers, etc.) from different sources (disk, network storage on WebAssembly, etc.) user_interface - use it to create user interface for your game, the interface is scene-independent and will remain the same even if there are multiple scenes created. renderer - can be used to add custom rendering techniques, change quality settings, etc. dt - a time passed since the last frame. The actual value is implementation-defined, but on current implementation it is equal to 1/60 of a second and does not change event if the frame rate is changing (the engine stabilizes update rate for the logic). lag - a reference to the time accumulator, that holds remaining amount of time that should be used to update a plugin. A caller splits lag into multiple sub-steps using dt and thus stabilizes update rate. The main use of this variable, is to be able to reset lag when you're doing some heavy calculations in a game loop (i.e. loading a new level) so the engine won't try to "catch up" with all the time that was spent in heavy calculation. serialization_context - it can be used to register scripts and custom scene nodes constructors at runtime. window - main application window, you can use it to change title, screen resolution, etc.

